import { jsPDF } from 'jspdf';

const regularFont = '';

const  boldFont = '';


export const addCandaraFont = (jsPDF: jsPDF) => {
  jsPDF.addFileToVFS('Candara-regular.ttf', regularFont);
  jsPDF.addFileToVFS('Candara_Bold-bold.ttf', boldFont);
  jsPDF.addFont('Candara-regular.ttf', 'Candara', 'normal');
  jsPDF.addFont('Candara_Bold-bold.ttf', 'Candara', 'bold');
}

